import React from "react";


import PlaceList from "../components/PlaceList";
const PLACES=[
    {id:'p1',title:'Taj Mahal', description:'Seventh Wonder of The World', imageUrl:'https://lh5.googleusercontent.com/p/AF1QipNjQ5SJFQ43S6nQHYkSflVjCaHqQGQdS8eEIL1f=w408-h277-k-no',address :'Agra',
    location:{
        lat:27.1751825,long:78.0397837
    },
    creator:'u1'}
];
const UserPlaces=()=>{
    return(
        <PlaceList items={PLACES}/>
    );  
};
export default UserPlaces;
